export default [
    {
        name: '首页',
        icon: 'home',
        path: '/admin/home',
        id: '0'
    },
    {
        name: '商品管理',
        icon: 'reddit',
        path: '/admin/goods',
        id: '1',
        children: [
            {
                name: '商品列表',
                id: '1-0',
            },
            {
                name: '商品详情',
                id: '1-1',
                children: [
                    {
                        name: '商品添加',
                        id: '1-1-0'
                    },
                    {
                        name: '商品上架',
                        id: '1-1-1',
                        children: [
                            {
                                name: '商品详情',
                                id: '1-1-1-0',
                            }
                        ]
                    },
                ]
            },
        ]
    },
    {
        name: '设置',
        icon: 'setting',
        path: '/admin/setting',
        id: '2'
    }
]
